import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Set a mobile viewport to ensure the mobile menu is visible
    await page.setViewportSize({ width: 375, height: 667 });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_mobile_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_mobile_view.png'));

    // Open the mobile menu to show the modal
    await page.waitForSelector('.nav-menu:has-text("All")', { timeout: 5000 });
    await page.click('.nav-menu:has-text("All")');

    // Wait for the modal to be visible
    const modal = await page.waitForSelector('#mobileMenuOverlay.show', { state: 'visible', timeout: 5000 });

    // Take screenshot with modal open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Press the Escape key to close the modal
    await page.keyboard.press('Escape');

    // Wait for the modal to be hidden
    await modal.waitFor({ state: 'hidden', timeout: 5000 });

    // Take screenshot with modal closed
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_closed.png'));

    // Verify the modal is no longer visible
    const isModalHidden = await page.locator('#mobileMenuOverlay').isHidden();

    return {
      success: true,
      action: "Successfully closed the modal using the Escape key.",
      extractedData: {
        isModalHidden: isModalHidden
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to close modal with Escape key",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
